//src/components/Navbar.js
import React from "react";
import Navbar from "./components/Navbar.js"; // Added .js extension
import Home from "./components/Home.js"; // Added .js extension
import About from "./components/About.js"; // Added .js extension
import Mission from "./components/Mission.js"; // Added .js extension
import Approach from "./components/Approach.js"; // Added .js extension
import Footer from "./components/Footer.js"; // Added .js extension
import "./App.css";

function App() {
  return (
    <div>
      <Navbar />
      <Home />
      <About />
      <Mission />
      <Approach />
      <Footer />
    </div>
  );
}

export default App;
